css:
.atomatigit {
  position: relative;
  overflow: auto;
  width: 30em;
  padding: 0px;
  border-left: 1px solid #9f9f9f;
  background-color: #e1e1e1;
  color: #444444;
}
.atomatigit .hidden {
  display: none;
}
.atomatigit .spinner {
  position: absolute;
  top: 1.5em;
  left: 1.5em;
  display: none;
}
.atomatigit .resize-handle {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  width: 10px;
  cursor: col-resize;
}
.atomatigit .input {
  background-color: #e1e1e1;
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  width: 100%;
  padding: 0px 1.5em 1em;
  margin: 0px;
  display: none;
}
.atomatigit .input.block .editor {
  height: 100px;
}
.atomatigit .commit-list-view .commit {
  padding: 0.5em 0px;
}
.atomatigit .commit-list-view .commit .id {
  font-weight: bold;
  display: inline-block;
  padding-left: 1.5em;
}
.atomatigit .commit-list-view .commit .author-name {
  font-style: italic;
  display: inline-block;
  padding-left: 0.5em;
}
.atomatigit .commit-list-view .commit .message {
  padding-left: 1.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.atomatigit .file .filename {
  padding: 0.5em;
  padding-left: 2.5em;
}
.atomatigit .file.selected .filename {
  background-color: #f4f4f4;
}
.atomatigit .file .diff {
  font-family: monospace;
}
.atomatigit .file .diff .diff-chunk {
  padding: 1em 0px;
  border-bottom: 1px solid #9f9f9f;
}
.atomatigit .file .diff .diff-chunk.selected {
  background-color: #fff;
}
.atomatigit .file .diff .diff-chunk .diff-line {
  padding-left: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.atomatigit .file .diff .diff-chunk .diff-line.addition {
  background-color: #cee9d9;
}
.atomatigit .file .diff .diff-chunk .diff-line.subtraction {
  background-color: #e9caca;
}
.atomatigit h2 {
  padding-left: 1.5em;
  font-size: 1.2em;
  font-weight: bold;
}
.atomatigit .branch-brief-view {
  padding: 0.5em;
  padding-left: 2.5em;
}
.atomatigit .branch-brief-view.selected {
  background-color: #f4f4f4;
}
.atomatigit .branch-brief-view .name {
  margin: 0px;
  font-weight: bold;
}
.atomatigit .branch-brief-view .commit {
  font-style: italic;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.atomatigit .branch-brief-view:hover {
  background-color: #ffffff;
  cursor: pointer;
}
.atomatigit .current-branch-view {
  text-align: right;
  padding: 2em;
  padding-bottom: 1em;
  background-color: #e1e1e1;
}
.atomatigit .current-branch-view.selected {
  background-color: #e1e1e1;
}
.atomatigit .current-branch-view.unpushed {
  color: #ff982d;
}
.atomatigit .current-branch-view .name {
  display: block;
  font-size: 2em;
}
.atomatigit .current-branch-view .commit {
  display: block;
}
.atomatigit .current-branch-view:hover {
  background-color: #e1e1e1;
}
.atomatigit.focused {
  background-color: #e9e9e9;
}
.atomatigit.focused .selected .filename,
.atomatigit.focused .branch-brief-view.selected,
.atomatigit.focused .commit.selected {
  background-color: #6aa5e9;
}
.atomatigit.focused .selected .filename .message,
.atomatigit.focused .branch-brief-view.selected .message,
.atomatigit.focused .commit.selected .message {
  color: #444444;
}
.atomatigit .atomatigit-error {
  display: none;
  margin: 2em;
}
.atomatigit .atomatigit-error .close-button {
  float: right;
  cursor: pointer;
}
.atomatigit .atomatigit-error .error-message {
  background-color: #000;
  color: #fff;
}
.atomatigit .tab-bar {
  display: -webkit-flex;
  margin: 0px;
  margin-bottom: 3em;
  border-bottom: 0px #fff;
  background: #e1e1e1;
}
.atomatigit .tab-bar .tab {
  -webkit-flex: 1;
  font-size: 11px;
  position: relative;
  padding-left: 10px;
  padding-right: 10px;
  max-width: 100px;
  min-width: 40px;
}
.atomatigit .tab-bar .tab.active {
  -webkit-flex: 2;
}
.atomatigit .tab-bar .tab .title {
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
}
.atomatigit .tab-bar .tab .title:first-letter {
  text-decoration: underline;
}
